import { StyledLayout, StyledMenu, StyledHeader, StyledRouting } from "./Layout.style";
// import Layout from "./Layout.css"; // Removed as the file does not exist

function Layout(): JSX.Element {
  return (
    <StyledLayout>
      <StyledMenu />
      <StyledHeader />
      <StyledRouting />
    </StyledLayout>
  );
}

export default Layout;
